"89455":{"id":"89455","name":"360: A vida é um círculo perfeito","slug":"360-a-vida-e-um-circulo-perfeito","original_title":"360","overview":"360 é uma reunião de histórias dinâmicas e modernas, passadas em diversas partes do mundo. Laura (Maria Flor) é uma mulher que deixou a vida na terra natal para tentar a sorte em Londres ao lado do namorado Rui (Juliano Cazarré). Ao descobrir que o parceiro está tendo um caso com Rose (Rachel Weisz), ela decide voltar para o Brasil. Na volta pra casa, ela conhece um simpático senhor (Anthony Hopkins) e Tyler (Ben Foster), duas pessoas em momentos difíceis em suas vidas. Num outro lado da história, Mirka (Lucia Siposová) é uma jovem tcheca que começa a trabalhar como prostituta para juntar dinheiro. Ao mesmo tempo, lida com a desaprovação da irmã Anna (Gabriela Marcinkova). O primeiro cliente de Mirka é Michael (Jude Law), que por sua vez é casado com Rose.","first_air_date":"2012-07-25","runtime":110,"episode_run_time":[110],"vote_average":5.7,"created_by":["BBC Film","O2 Filmes","Revolution Films","Wild Bunch","Unison Films","Hero Entertainment","Dor Film","Fidélité Films","ORF"],"production_companies":[{"name":"BBC Film"},{"name":"O2 Filmes"},{"name":"Revolution Films"},{"name":"Wild Bunch"},{"name":"Unison Films"},{"name":"Hero Entertainment"},{"name":"Dor Film"},{"name":"Fidélité Films"},{"name":"ORF"}],"cast":["Rachel Weisz","Jude Law","Ben Foster","Anthony Hopkins","Moritz Bleibtreu"],"backdrop_path":"https://image.tmdb.org/t/p/original/npIWAwSta6hOpU9BOJzvCD1qwf4.jpg","poster_path":"https://image.tmdb.org/t/p/original/xzI3p0c2oFRMx5fYQg2BoQzYCE0.jpg","certification":"14","genres":["Drama","Romance"],"trailer":"N/A"},
