"25132":{"id":"25132","name":"A Pedra Mágica","slug":"a-pedra-magica","original_title":"Shorts","overview":"A grande maioria da população de Black Falls trabalha na Black Box Unlimited Worldwide Industries Incorporated, cujo aparelho Black Box tornou-se uma febre no mundo inteiro. Entretanto esta situação pouco afeta Toe Thompson (Jimmy Bennett), um garoto de 11 anos que apenas deseja ter alguns amigos. Um dia ele encontra uma pedra com as cores do arco-íris, que misteriosamente caiu do céu. A partir de então tudo muda para Toe, já que a pedra permite que os desejos de quem a segure sejam realizados. Logo ela roda pela vizinhança, tornando-se perigosa quando chega às mãos dos adultos.","first_air_date":"2009-08-21","runtime":89,"episode_run_time":[89],"vote_average":5.8,"created_by":["Troublemaker Studios","Image Nation Abu Dhabi","MRC"],"production_companies":[{"name":"Troublemaker Studios"},{"name":"Image Nation Abu Dhabi"},{"name":"MRC"}],"cast":["Jimmy Bennett","Jake Short","Kat Dennings","Trevor Gagnon","Devon Gearhart"],"backdrop_path":"https://image.tmdb.org/t/p/original/c9d0Mp6sWdneRp85etaW3jz6KMg.jpg","poster_path":"https://image.tmdb.org/t/p/original/ry3eJ1mfV5fqe0I7dIi5c5VENjh.jpg","certification":"N/A","genres":["Família","Fantasia","Comédia","Aventura","Ficção científica"],"trailer":"N/A"},
