"518502":{"id":"518502","name":"O Inimaginável","slug":"o-inimaginavel","original_title":"Den blomstertid nu kommer","overview":"É meio do verão e a Suécia acorda em estado de emergência. As redes de televisão, Internet e telefone estão fora do ar e, antes que alguém perceba o que está por trás do colapso, uma série de ataques inexplicáveis estão ocorrendo em todo o país. Alex, um pianista de sucesso cuja existência controlada muda quando sua mãe é morta em um suposto ataque terrorista, retorna à aldeia de sua infância para organizar o funeral. Lá, ele deve se reconciliar com seu pai e seu antigo amor, Anna, a quem ele tem tentado desesperadamente esquecer. À medida que velhos sentimentos ressurgem, mais ataques misteriosos mergulham a Suécia no caos e na confusão.","first_air_date":"2018-06-20","runtime":129,"episode_run_time":[129],"vote_average":5.7,"created_by":["Crazy Pictures"],"production_companies":[{"name":"Crazy Pictures"}],"cast":["Christoffer Nordenrot","Lisa Henni","Jesper Barkselius","Pia Halvorsen","Magnus Sundberg"],"backdrop_path":"https://image.tmdb.org/t/p/original/uQt8RztoyGp91XoijDU64T37llO.jpg","poster_path":"https://image.tmdb.org/t/p/original/h6HOWWopDslFD9X3v82yZLGp61I.jpg","certification":"N/A","genres":["Thriller","Ação","Ficção científica","Drama"],"trailer":"N/A"},
