"22949":{"id":"22949","name":"Surpresa em Dobro","slug":"surpresa-em-dobro","original_title":"Old Dogs","overview":"Charlie (John Travolta) e Dan (Robin Williams) são amigos de longa data, que possuem uma empresa de marketing esportivo. Eles estão prestes a fechar o negócio de suas vidas com uma empresa japonesa, comandada por Yoshiro Nishamura (Sab Shimono). Um dia, Dan recebe uma carta de Vicki (Kelly Preston), dizendo que deseja encontrá-lo. Ela se casou com Dan anos atrás, mas o matrimônio durou apenas um dia pois estavam bêbados quando a cerimônia foi realizada. Desde então perderam contato, apesar de Dan ainda gostar dela. Ele se prepara para o encontro, sem imaginar o que está por vir: Vicki está prestes a ser detida em uma penitenciária por duas semanas e deseja apresentar a Dan os filhos que fizeram naquela única noite, Zach (Conner Rayburn) e Emily (Ella Bleu Travolta).","first_air_date":"2009-11-24","runtime":88,"episode_run_time":[88],"vote_average":5.5,"created_by":["Walt Disney Pictures","Tapestry Films"],"production_companies":[{"name":"Walt Disney Pictures"},{"name":"Tapestry Films"}],"cast":["John Travolta","Robin Williams","Kelly Preston","Conner Rayburn","Ella Bleu Travolta"],"backdrop_path":"https://image.tmdb.org/t/p/original/EWqsvSabOaPW6BUQlb8O868mKw.jpg","poster_path":"https://image.tmdb.org/t/p/original/tv2wLc1iu1YeootT3fn6AdQzoMm.jpg","certification":"N/A","genres":["Comédia","Família"],"trailer":"N/A"},
