"81836":{"id":"81836","name":"Para Roma com Amor","slug":"para-roma-com-amor","original_title":"To Rome with Love","overview":"O longa é dividido em quatro segmentos. Em um deles, um casal americano (Woody Allen e Judy Davis) viajam para Roma para conhecer a família do noivo de sua filha. Outra história envolve Leopoldo (Roberto Benigni), um homem comum que é confundido com uma estrela de cinema. Um terceiro episódio retrata um arquiteto da Califórnia (Alec Baldwin) que visita a Itália com um grupo de amigos. Por último, temos dois jovens recém-casados que se perdem pelas confusas ruas de Roma.","first_air_date":"2012-04-20","runtime":111,"episode_run_time":[111],"vote_average":5.8,"created_by":["Perdido Productions","Medusa Film","Gravier Productions"],"production_companies":[{"name":"Perdido Productions"},{"name":"Medusa Film"},{"name":"Gravier Productions"}],"cast":["Woody Allen","Roberto Benigni","Penélope Cruz","Alec Baldwin","Judy Davis"],"backdrop_path":"https://image.tmdb.org/t/p/original/l6kiBvruMr5qPsTyv853jIlj2pv.jpg","poster_path":"https://image.tmdb.org/t/p/original/rWvCbtUZZw0wCNDGItqrkxqYQ7B.jpg","certification":"12","genres":["Comédia","Romance"],"trailer":"N/A"},
