"12535":{"id":"12535","name":"Alta Ansiedade","slug":"alta-ansiedade","original_title":"High Anxiety","overview":"Richard Thorndyke chega ao Instituto Neuro-Psiquiátrico Para os Muito, Muito Nervosos para tornar-se seu diretor. Mas suas novas funções vão muito além de garantir que tudo funcione da forma correta: ele foi chamado principalmente para descobrir a origem de falcatruas que andam acontecendo lá dentro. Tudo complica ainda mais quando ele próprio é ameaçado de morte, por saber demais, o que traz a tona seu próprio problema psicológico: ele sofre de alta ansiedade! O filme faz homenagem explícita as obras de Alfred Hitchcock. Algumas sequências trazem paródias de cenas famosas de filmes como Os Pássaros, Psicose e Um Corpo que Cai.","first_air_date":"1977-12-25","runtime":94,"episode_run_time":[94],"vote_average":6.4,"created_by":["Crossbow Productions","20th Century Fox"],"production_companies":[{"name":"Crossbow Productions"},{"name":"20th Century Fox"}],"cast":["Mel Brooks","Madeline Kahn","Cloris Leachman","Harvey Korman","Ron Carey"],"backdrop_path":"https://image.tmdb.org/t/p/original/uZK6kGcO2RRteHoEgkpH4Mwa3lf.jpg","poster_path":"https://image.tmdb.org/t/p/original/rZMIvi2Wepa1a5CPN0DvnO4B8x.jpg","certification":"N/A","genres":["Comédia","Mistério","Thriller"],"trailer":"N/A"},
