"9566":{"id":"9566","name":"Estranha Obsessão","slug":"estranha-obsessao","original_title":"The Fan","overview":"Gil Renard (De Niro) é um torcedor fanático que, como tantos outros, lotam estádios para vibrar, sofrer e se envolver em cada partida. Mas a vida de Gil não vai nada bem e para seu total desespero Bobby Rayburn (Snipes), o jogador mais caro de seu time, entra numa fase ruim. Gil acredita ser o único capaz de ajudar seu ídolo e está disposto a tudo para ver seu time vencer...tudo mesmo. Sua adoração se transforma em uma perigosa obsessão sem limites e sem piedade. Ele coloca vidas em risco e pode estar em qualquer lugar, nas arquibancadas, no campo, no vestiário, ou bem ao lado de sua vítima!","first_air_date":"1996-08-15","runtime":116,"episode_run_time":[116],"vote_average":6.0,"created_by":["TriStar Pictures","Mandalay Entertainment","Scott Free Productions"],"production_companies":[{"name":"TriStar Pictures"},{"name":"Mandalay Entertainment"},{"name":"Scott Free Productions"}],"cast":["Robert De Niro","Wesley Snipes","Ellen Barkin","John Leguizamo","Benicio del Toro"],"backdrop_path":"https://image.tmdb.org/t/p/original/dISWllRkiQ1l5Nbn5JMZbz6RHoh.jpg","poster_path":"https://image.tmdb.org/t/p/original/5Jh4MIU1NC0YjWVFcYvcI4lW7MC.jpg","certification":"N/A","genres":["Thriller","Ação","Drama"],"trailer":"N/A"},
