"8348":{"id":"8348","name":"O Último Golpe","slug":"o-ultimo-golpe","original_title":"Thunderbolt and Lightfoot","overview":"Passados sete anos de um ousado assalto a banco, o time de ladrões decidiu se aposentar e se separar para não levantar suspeitas. Ocorre que Thunderbolt (Clint Eastwood) é procurado pelos antigos parceiros, que pensam que o colega ficou com a parte deles no assalto. Quem o ajuda a escapar é um de seus amigos, o atrapalhado Lightfoot (Jeff Bridges). Este convence Thunderbolt a voltar à ativa e realizar um último assalto, ainda mais audacioso. Filme que marca a estréia de Michael Cimino na direção.","first_air_date":"1974-05-23","runtime":114,"episode_run_time":[114],"vote_average":6.7,"created_by":["Malpaso Productions","United Artists"],"production_companies":[{"name":"Malpaso Productions"},{"name":"United Artists"}],"cast":["Clint Eastwood","Jeff Bridges","George Kennedy","Geoffrey Lewis","Catherine Bach"],"backdrop_path":"https://image.tmdb.org/t/p/original/gZeAboSvbuqTsKyhjDUHpHAUqBl.jpg","poster_path":"https://image.tmdb.org/t/p/original/zWf5CrDCv0jGLtv78GKJSJGNpAh.jpg","certification":"N/A","genres":["Crime","Comédia","Ação","Drama"],"trailer":"N/A"},
