"18783":{"id":"18783","name":"Sahara: Em Busca da Sobrevivência","slug":"sahara-em-busca-da-sobrevivencia","original_title":"Sahara","overview":"O sargento Joe Gunn e sua tripulação de tanque acolhem cinco soldados britânicos, um francês e um sudanês com um prisioneiro italiano, e cruzam o deserto da Líbia para voltar ao comando após a queda de Tobruk. Tambul, o sudanês leva-os a uma fortaleza abandonada no deserto onde eles esperam encontrar água. Logo um destacamento de soldados alemães chega e tenta barganhar comida por água, mas Gunn e sua turma recusam. Quando os alemães atacam, Gunn leva seus homens cansados do deserto em uma batalha desesperada, esperando que os reforços britânicos possam chegar a tempo.","first_air_date":"1943-09-22","runtime":97,"episode_run_time":[97],"vote_average":7.2,"created_by":["Columbia Pictures"],"production_companies":[{"name":"Columbia Pictures"}],"cast":["Humphrey Bogart","Bruce Bennett","J. Carrol Naish","Lloyd Bridges","Rex Ingram"],"backdrop_path":"https://image.tmdb.org/t/p/original/e3U2mnT9JPyruXEKi78TWmRN0I2.jpg","poster_path":"https://image.tmdb.org/t/p/original/roVIPqVLMdvs7uOcqDuwO891t8s.jpg","certification":"N/A","genres":["Aventura","Guerra"],"trailer":"N/A"},
