"33511":{"id":"33511","name":"O Garoto de Liverpool","slug":"o-garoto-de-liverpool","original_title":"Nowhere Boy","overview":"John Lennon é um jovem que não aceita bem as regras impostas na escola e dentro de casa. Abandonado pela mãe quando tinha cinco anos, ele vive com seus tios George e Mimi. Quando George morre, Lennon é obrigado a viver com Mimi, extremamente austera e sisuda. No funeral do tio, ele vê sua mãe, que se mantém afastada. Seu primo consegue o endereço dela, o que faz com que Lennon resolva visitá-la. O reencontro do o filho é a realização de um sonho para Julia, que passa cada vez mais seu tempo com ele. Animada e um tanto quanto inconsequente, ela apresenta ao filho o rock’n’roll. Logo, desperta nele a vontade de montar uma banda de rock.","first_air_date":"2009-12-25","runtime":98,"episode_run_time":[98],"vote_average":7.2,"created_by":["Lipsync Productions","Ecosse Films","UK Film Council","Aver Media","North West Vision","Film4 Productions","Icon Productions"],"production_companies":[{"name":"Lipsync Productions"},{"name":"Ecosse Films"},{"name":"UK Film Council"},{"name":"Aver Media"},{"name":"North West Vision"},{"name":"Film4 Productions"},{"name":"Icon Productions"}],"cast":["Aaron Taylor-Johnson","Anne-Marie Duff","Kristin Scott Thomas","David Threlfall","David Morrissey"],"backdrop_path":"https://image.tmdb.org/t/p/original/ouMbyjN1WJKyRqgvwovGl58e4eR.jpg","poster_path":"https://image.tmdb.org/t/p/original/kyqiMQWssWGR9nXPqA5J4Gzb7vc.jpg","certification":"14","genres":["Drama"],"trailer":"N/A"},
