"9569":{"id":"9569","name":"Difícil de Matar","slug":"dificil-de-matar","original_title":"Hard to Kill","overview":"Em Los Angeles, 1983, Mason Storm, um detetive da polícia, investiga Vernon Trent, um político corrupto que, ao saber que Mason tinha gravado uma fita que o comprometia seriamente, ordena uma emboscada contra a família Storm, que resulta na morte de Felicia, a mulher de Mason. No entanto, Sonny, o filho do casal consegue escapar. Quanto a Mason, ele fica tão seriamente ferido que inicialmente foi dado como morto, mas ficou em coma até 1990. Assim que ele sai do coma a notícia chega aos responsáveis pelo atentado, que mandam um assassino até o hospital para terminar o serviço. Porém, prevendo a gravidade da situação ele pede para Andy Stewart, sua enfermeira, que o tire logo dali. Ela não o atende logo, mas quando vê que se ficarem no hospital morrerão o retira do local e leva Mason para a casa de um amigo, que ficará no exterior por seis meses. Agora Mason tem tempo para se recuperar e preparar sua vingança.","first_air_date":"1990-02-09","runtime":95,"episode_run_time":[95],"vote_average":6.0,"created_by":["Warner Bros. Pictures","Lee Rich Productions"],"production_companies":[{"name":"Warner Bros. Pictures"},{"name":"Lee Rich Productions"}],"cast":["Steven Seagal","Kelly LeBrock","William Sadler","Frederick Coffin","Bonnie Burroughs"],"backdrop_path":"https://image.tmdb.org/t/p/original/7eBAGOeAX7PWqYo9QVVeGjndMRk.jpg","poster_path":"https://image.tmdb.org/t/p/original/ytZk9AnveQLkDyOTv5tihQzhrcg.jpg","certification":"N/A","genres":["Ação","Drama","Crime","Thriller"],"trailer":"N/A"},
