"433627":{"id":"433627","name":"7 Dias em Entebbe","slug":"7-dias-em-entebbe","original_title":"7 Days in Entebbe","overview":"Em julho de 1976, um voo da Air France de Tel-Aviv à Paris foi sequestrado e forçado a pousar em Entebbe, na Uganda. Os passageiros judeus foram mantidos reféns para ser negociada a liberação dos terroristas e anarquistas palestinos presos em Israel, na Alemanha e na Suécia. Sob pressão, o governo israelita decidiu organizar uma operação de resgate atacar o campo de pouso e soltar os reféns.","first_air_date":"2018-03-15","runtime":107,"episode_run_time":[107],"vote_average":5.8,"created_by":["Participant","Working Title Films"],"production_companies":[{"name":"Participant"},{"name":"Working Title Films"}],"cast":["Rosamund Pike","Daniel Brühl","Eddie Marsan","ליאור אשכנזי","Nonso Anozie"],"backdrop_path":"https://image.tmdb.org/t/p/original/aJKvkpFEmuU8JlxqUlHYSo2LN3w.jpg","poster_path":"https://image.tmdb.org/t/p/original/idhwFpYjSRuEK5fYpsIJFgqkMRD.jpg","certification":"12","genres":["Thriller","Drama","Crime"],"trailer":"N/A"},
