"174321":{"id":"174321","name":"Adorável Professora","slug":"adoravel-professora","original_title":"The English Teacher","overview":"Linda Sinclair (Julianne Moore) é uma professora de inglês solteira, que tem 40 anos e vive na pequena cidade de Kingston. Ela leva uma vida tranquila até reencontrar um antigo aluno, Jason Sherwood (Michael Angarano), que acaba de retornar à cidade. Jason tem o sonho de se tornar um grande autor teatral, mas está prestes a abandoná-lo devido à pressão de seu pai, Tom (Greg Kinnear), para que procure um emprego que possa sustentá-lo. Para ajudá-lo, Linda resolve encenar a peça escrita por Jason na escola em que trabalha, tendo como diretor o professor Carl Kapinas (Nathan Lane). Só que a situação faz com que ela deixe sua zona de conforto, especialmente quando percebe que sente algo mais por Jason.","first_air_date":"2013-05-16","runtime":93,"episode_run_time":[93],"vote_average":5.6,"created_by":["Mirabelle Pictures Productions","Artina Films","Procinvest Sas"],"production_companies":[{"name":"Mirabelle Pictures Productions"},{"name":"Artina Films"},{"name":"Procinvest Sas"}],"cast":["Julianne Moore","Michael Angarano","Greg Kinnear","Lily Collins","Fiona Shaw"],"backdrop_path":"https://image.tmdb.org/t/p/original/rMrtoZfd0B0jDc1IW6r7MHELAtt.jpg","poster_path":"https://image.tmdb.org/t/p/original/pXIKNiDzXl8irCtHJhx6bSwvcvo.jpg","certification":"N/A","genres":["Comédia","Drama","Romance"],"trailer":"N/A"},
