"9621":{"id":"9621","name":"Tudo Acontece em Elizabethtown","slug":"tudo-acontece-em-elizabethtown","original_title":"Elizabethtown","overview":"Após provocar um prejuízo de US$ 972 milhões para a Mercury, a maior empresa de esportes dos Estados Unidos, ao elaborar um tênis que foi um fiasco, Drew Baylor é demitido pelo magnata Phil DeVoss. Ellen Kishmore, sua namorada, acaba com Drew. Ele decide cometer suicídio e estava para executá-lo, quando o celular toca. Drew atende e sabe através da sua irmã, Heather, que o pai deles, Mitchell, morrera de infarto em Elizabethtown. Heather diz que ela e a mãe deles, Hollie, precisam do apoio dele e, além disto, teria de ir até Elizabethtown para ajudar a organizar o funeral. No vôo ele conhece Claire Colburn, uma aeromoça que lhe dá alguma esperança no futuro. Porém este futuro pode ser incerto, pois as pessoas que crêem nele são os moradores de sua cidade, que o julgam um vencedor. Mas logo será publicado que Drew cometeu um dos maiores fiascos comerciais do país.","first_air_date":"2005-10-14","runtime":124,"episode_run_time":[124],"vote_average":6.2,"created_by":["Paramount Pictures","Cruise/Wagner Productions","Vinyl Films","KMP Film Invest"],"production_companies":[{"name":"Paramount Pictures"},{"name":"Cruise/Wagner Productions"},{"name":"Vinyl Films"},{"name":"KMP Film Invest"}],"cast":["Orlando Bloom","Kirsten Dunst","Susan Sarandon","Alec Baldwin","Bruce McGill"],"backdrop_path":"https://image.tmdb.org/t/p/original/cx2nwab4wKPpmQ9uacgBU7jJfEp.jpg","poster_path":"https://image.tmdb.org/t/p/original/qBrP2hUibgAnoh3em9YtbTqM7EY.jpg","certification":"N/A","genres":["Comédia","Drama","Romance"],"trailer":"N/A"},
