"40682":{"id":"40682","name":"Os Chacais do Oeste","slug":"os-chacais-do-oeste","original_title":"The Train Robbers","overview":"Três veteranos da guerra civil americana se unem a uma viúva ladra de trens para reaver meio milhão de dólares em ouro escondido. A viúva (Ann Margret), é o tipo de pessoa que quer tudo no lugar certo, deseja limpar o nome de seu marido. Os três amigos (John Waine, Rod Taylor e Ben Johnson) querem ajudá-la e receber uma recompensa de US$ 50 mil. Mas os ex-parceiros do falecido querem apenas o ouro, e matarão por ele. Esse filme é um incrível conto do escritor/diretor Burt Kennedy, um especialista em faroestes com toques cômicos. Aqui, ele estabelece um clima de amigável aventura em meio a personagens interessantíssimos, um pouco diferente dos faroestes normalmente estrelados por John Waine.","first_air_date":"1973-02-01","runtime":92,"episode_run_time":[92],"vote_average":6.3,"created_by":["Batjac Productions"],"production_companies":[{"name":"Batjac Productions"}],"cast":["John Wayne","Ann-Margret","Rod Taylor","Ben Johnson","Christopher George"],"backdrop_path":"https://image.tmdb.org/t/p/original/tg8vdaC4SO4GNTHYweTVmWXSehV.jpg","poster_path":"https://image.tmdb.org/t/p/original/k9TWEDuvENME9m5SK9OQR9FaSiX.jpg","certification":"12","genres":["Faroeste","Ação"],"trailer":"N/A"},
"411976":{"id":"411976","name":"Noviciado","slug":"noviciado","original_title":"Novitiate","overview":"No início da década de 1960, à altura do Concílio Vaticano II, a jovem Cathleen decide se tornar freira, para espanto de sua mãe agnóstica. No convento, ela se vê em um ambiente dominado pela devoção e pelas estritas regras da madre superiora. Uma história de amadurecimento tendo como pano de fundo as radicais mudanças da igreja católica à época, o filme retrata um grupo de mulheres e suas autodescobertas de fé e de paixão para além da religião.","first_air_date":"2017-10-27","runtime":123,"episode_run_time":[123],"vote_average":6.4,"created_by":["Maven Screen Media"],"production_companies":[{"name":"Maven Screen Media"}],"cast":["Margaret Qualley","Melissa Leo","Julianne Nicholson","Dianna Agron","Lisa Stewart"],"backdrop_path":"https://image.tmdb.org/t/p/original/4MLjm9ghDgx2cccqdKDRhBla9VT.jpg","poster_path":"https://image.tmdb.org/t/p/original/3J2omRa2Scb9dhBuHXzVpdTgdD2.jpg","certification":"16","genres":["Drama"],"trailer":"N/A"},
