"417812":{"id":"417812","name":"Vida Selvagem","slug":"vida-selvagem","original_title":"Wildlife","overview":"Aos 14 anos de idade, Joe (Ed Oxenbould) começa a perceber que sua família está desmoronando. O pai, Jerry (Jake Gyllenhaal), acaba de perder o emprego, mas não quer que a esposa trabalhe. A mãe, Jeanette (Carey Mulligan), não pretende ficar de braços cruzados diante da crise e começa a ganhar sua autonomia. Quando Jerry decide ficar muitos meses fora de casa, num trabalho temporário apagando incêndios pela região, Jeanette decide que é hora de refazer a sua vida. Mas para Joe, a única coisa que importa é ver os pais reunidos novamente.","first_air_date":"2018-09-23","runtime":105,"episode_run_time":[105],"vote_average":6.6,"created_by":["Sight Unseen Pictures","June Pictures","Nine Stories Productions"],"production_companies":[{"name":"Sight Unseen Pictures"},{"name":"June Pictures"},{"name":"Nine Stories Productions"}],"cast":["Jake Gyllenhaal","Carey Mulligan","Ed Oxenbould","Zoe Colletti","Bill Camp"],"backdrop_path":"https://image.tmdb.org/t/p/original/hDtiyCztpFdv9yLNSwNblhOjLKJ.jpg","poster_path":"https://image.tmdb.org/t/p/original/z5w5hM3tg9VzXaOOdR7m5cWayEn.jpg","certification":"14","genres":["Drama"],"trailer":"N/A"},
