"15919":{"id":"15919","name":"Marty","slug":"marty","original_title":"Marty","overview":"Marty Piletti é um açougueiro ítalo-americano, tímido e solitário, e que vive no Bronx em Nova Iorque. Ele acredita que nunca nenhuma mulher se interessará por ele mas, por insistência de sua mãe, ele sai uma noite para dançar e conhece uma professora, que se sente tão rejeitada quanto ele. A insegurança dos dois, porém, é um entrave que pode prejudicar a relação deles.","first_air_date":"1955-04-11","runtime":91,"episode_run_time":[91],"vote_average":7.4,"created_by":["United Artists","Hecht-Lancaster Productions"],"production_companies":[{"name":"United Artists"},{"name":"Hecht-Lancaster Productions"}],"cast":["Ernest Borgnine","Betsy Blair","Esther Minciotti","Augusta Ciolli","Joe Mantell"],"backdrop_path":"https://image.tmdb.org/t/p/original/zhZtaNcjtc6VgV8SC4VlokiaeNt.jpg","poster_path":"https://image.tmdb.org/t/p/original/8tnGO5VoAQII4DbE3hozWKhV4BY.jpg","certification":"N/A","genres":["Drama","Romance"],"trailer":"N/A"},
"823766":{"id":"823766","name":"O Milagre","slug":"o-milagre","original_title":"The Wonder","overview":"Em O Milagre, inspirado no fenômeno do século 19 das \"garotas em jejum\" e adaptado do aclamado romance de Emma Donoghue (Quarto), na Irlanda de 1862, uma jovem para de comer, mas permanece milagrosamente viva e bem. A enfermeira inglesa Lib Wright é levada a essa pequena vila para observar Anna O'Donnell, de onze anos. Turistas e peregrinos se reúnem para testemunhar a menina que teria sobrevivido sem comida por meses. Nesse thriller psicológico, o grande mistério gira em torno dessa aldeia, que pode estar abrigando um santo - ou mistérios mais sinistros do que parecem.","first_air_date":"2022-11-02","runtime":108,"episode_run_time":[108],"vote_average":6.6,"created_by":["Element Pictures","House Productions"],"production_companies":[{"name":"Element Pictures"},{"name":"House Productions"}],"cast":["Florence Pugh","Kíla Lord Cassidy","Tom Burke","Niamh Algar","Elaine Cassidy"],"backdrop_path":"https://image.tmdb.org/t/p/original/hJN3ZaueIDWFO5FfxoXdiP6Y4oH.jpg","poster_path":"https://image.tmdb.org/t/p/original/cGrlQaZprXLpULIGQFG2pMuVSoz.jpg","certification":"14","genres":["Drama","Mistério"],"trailer":"N/A"},
