"318850":{"id":"318850","name":"O Jovem Messias","slug":"o-jovem-messias","original_title":"The Young Messiah","overview":"Aos sete anos, Jesus vive com sua família em Alexandria, Egito, onde eles fugiram para evitar o massacre de crianças pelo Rei Herodes de Israel. Jesus sabe que seus pais, José e Maria, mantêm segredos sobre seu nascimento e o tratamento que o faz diferente de outros garotos. Seus pais, porém, acreditam que ainda é cedo para lhe contar a verdade de seu milagroso nascimento e seu propósito. Com a morte do Rei, eles resolvem voltar para sua terra natal, Nazaré, sem saber que o herdeiro do trono, o novo rei, é como seu pai e está determinado a matar Jesus, ao mesmo tempo em que ele descobre a verdade sobre a sua vida.","first_air_date":"2016-03-10","runtime":111,"episode_run_time":[111],"vote_average":6.4,"created_by":["Focus Features"],"production_companies":[{"name":"Focus Features"}],"cast":["Adam Greaves-Neal","Sara Lazzaro","Vincent Walsh","Sean Bean","Jonathan Bailey"],"backdrop_path":"https://image.tmdb.org/t/p/original/6dzAELFO8H9s7g9RVmKan4mvH6F.jpg","poster_path":"https://image.tmdb.org/t/p/original/YRbIclm6OhqzegE4JqNkPtDfJk.jpg","certification":"N/A","genres":["Drama"],"trailer":"UUQgadbTHEI"},
