"31102":{"id":"31102","name":"Pollyanna","slug":"pollyanna","original_title":"Pollyanna","overview":"Numa pequena cidade do interior americano vive a jovem Pollyana, uma pequena órfã que ilumina a vida de todos que a conhecem. Sua tia Polly, preocupada com aparências, política e posses, tem problemas em aceitar a alegria da sobrinha. Somente quando a cidade quase perde a sua habitante mais querida é que tia Polly entende a importância do amor e da esperança.","first_air_date":"1960-05-19","runtime":134,"episode_run_time":[134],"vote_average":7.0,"created_by":["Walt Disney Productions"],"production_companies":[{"name":"Walt Disney Productions"}],"cast":["Hayley Mills","Jane Wyman","Richard Egan","Karl Malden","Nancy Olson"],"backdrop_path":"https://image.tmdb.org/t/p/original/daAGNEXy8VC0VXWG1QZCrZhUqKJ.jpg","poster_path":"https://image.tmdb.org/t/p/original/9lWkRXg35SjUZXLr10ez8DERvRv.jpg","certification":"e Livre","genres":["Comédia","Drama","Família"],"trailer":"N/A"},
