"27029":{"id":"27029","name":"Uma Cruz à Beira do Abismo","slug":"uma-cruz-a-beira-do-abismo","original_title":"The Nun's Story","overview":"Em 1930, o jovem Gabrielle Van der Mal entra em um convento em sua Bélgica natal para se tornar uma freira. Quase imediatamente, ela tem dificuldade para se ajustar à vida de clausura, e seu votos de pobreza, castidade e obediência. Ela duvida a sua própria capacidade, mesmo quando ela faz seus votos perpétuos. Gabrielle, agora chamada de Irmã Luke, se destaca em seus estudos médicos e sonhos de servir no Congo Belga.","first_air_date":"1959-06-18","runtime":149,"episode_run_time":[149],"vote_average":7.2,"created_by":["Warner Bros. Pictures"],"production_companies":[{"name":"Warner Bros. Pictures"}],"cast":["Audrey Hepburn","Peter Finch","Edith Evans","Peggy Ashcroft","Dean Jagger"],"backdrop_path":"https://image.tmdb.org/t/p/original/nHcXQKWnnk7VEAg9WbGjL3OpZXG.jpg","poster_path":"https://image.tmdb.org/t/p/original/f5yaiqP62O1C2x2pE4YIYD71cM5.jpg","certification":"12","genres":["Drama"],"trailer":"N/A"},
