"11121":{"id":"11121","name":"Tess - Uma Lição de Vida","slug":"tess-uma-licao-de-vida","original_title":"Tess","overview":"Na Inglaterra do século 19, a bela Tess, filha de um fazendeiro, é enviada para viver com parentes nobres. Ela é seduzida e abandonada por seu primo distante, Alec. De volta à fazenda de seu pai, ela dá à luz um bebê natimorto e enfrenta a hipocrisia da sociedade. Baseado no romance de Thomas Hardy.","first_air_date":"1979-10-06","runtime":171,"episode_run_time":[171],"vote_average":7.1,"created_by":["Renn Productions","Timothy Burrill Productions","SFP"],"production_companies":[{"name":"Renn Productions"},{"name":"Timothy Burrill Productions"},{"name":"SFP"}],"cast":["Nastassja Kinski","Peter Firth","Leigh Lawson","John Collin","Rosemary Martin"],"backdrop_path":"https://image.tmdb.org/t/p/original/hEVAABU2c86MU42jlnGRM9FcCq5.jpg","poster_path":"https://image.tmdb.org/t/p/original/dJKSee0Dvurz215ziq1uaxRc236.jpg","certification":"14","genres":["Drama","Romance"],"trailer":"N/A"},
