"4380":{"id":"4380","name":"Dança Comigo?","slug":"danca-comigo","original_title":"Shall We Dance?","overview":"Há vários anos o advogado John Clark, especialista em testamentos, leva uma vida rotineira do trabalho para casa e de casa para o trabalho. Apesar de amar sua mulher, Beverly, e seus filhos, John sente que algo está faltando algo em sua vida. Por acaso vê na janela de uma academia Paulina, uma bela professora de dança. Esperando se aproximar dela, John se matricula na academia. Paulina rapidamente elimina qualquer possibilidade de envolvimento com John, mas isto não o faz deixar de ir às aulas, pois ele acha cada vez mais relaxante e divertido dançar.","first_air_date":"2004-10-15","runtime":107,"episode_run_time":[107],"vote_average":6.4,"created_by":["Miramax","Simon Fields Productions"],"production_companies":[{"name":"Miramax"},{"name":"Simon Fields Productions"}],"cast":["Richard Gere","Jennifer Lopez","Susan Sarandon","Stanley Tucci","Lisa Ann Walter"],"backdrop_path":"https://image.tmdb.org/t/p/original/dbk1GH7eRmUrs8y9WFQP1corti2.jpg","poster_path":"https://image.tmdb.org/t/p/original/nBjSWrqs84g8fSbuCoU3WC0t8VX.jpg","certification":"L","genres":["Drama","Romance","Comédia"],"trailer":"N/A"},
