"265297":{"id":"265297","name":"O Sal da Terra","slug":"o-sal-da-terra","original_title":"Le sel de la terre","overview":"Nos últimos 40 anos, o fotógrafo Sebastião Salgado tem viajado através dos continentes, aos passos de uma humanidade sempre em mutação. Ele testemunhou alguns dos principais eventos da nossa história recente; conflitos internacionais, a fome e o êxodo. Ele agora embarca na descoberta de territórios imaculados, da flora e da fauna selvagem e de paisagens grandiosas como parte de um enorme projeto fotográfico. Uma homenagem à beleza do planeta.","first_air_date":"2014-08-29","runtime":110,"episode_run_time":[110],"vote_average":8.1,"created_by":["Secretaria de Estado de Cultura do Espírito Santo","Decia Films","Amazonas Images","Solares Fondazione delle Arti","La Région Île-de-France","Maison Européenne de la Photographie","Serviçio Social do Comércio"],"production_companies":[{"name":"Secretaria de Estado de Cultura do Espírito Santo"},{"name":"Decia Films"},{"name":"Amazonas Images"},{"name":"Solares Fondazione delle Arti"},{"name":"La Région Île-de-France"},{"name":"Maison Européenne de la Photographie"},{"name":"Serviçio Social do Comércio"}],"cast":["Sebastião Salgado","Wim Wenders","Juliano Ribeiro Salgado","Hugo Barbier","Lélia Wanick Salgado"],"backdrop_path":"https://image.tmdb.org/t/p/original/lqtzWKCpejXdKb22cav5bB6MqSR.jpg","poster_path":"https://image.tmdb.org/t/p/original/co47qUCNSa3LIPWwNcqq0PGhnJJ.jpg","certification":"N/A","genres":["Documentário"],"trailer":"N/A"},
