"1206617":{"id":"1206617","name":"O Melhor Espetáculo de Natal de Todos os Tempos","slug":"o-melhor-espetaculo-de-natal-de-todos-os-tempos","original_title":"The Best Christmas Pageant Ever","overview":"Os Herdmans são as piores crianças do mundo. Mentem, roubam, fazem bullying… e agora invadiram o evento de Natal da cidade. Grace vai dirigir a peça teatral pela primeira vez, só que ela e a família estão em apuros, principalmente porque ninguém quer os Herdmans ali. Mas acontece que os pequenos atores travessos podem ensinar à cidade o verdadeiro sentido do Natal.","first_air_date":"2024-11-07","runtime":99,"episode_run_time":[99],"vote_average":6.9,"created_by":["Kingdom Story Company","FletChet Entertainment","Lionsgate","Lumenas Studios","Media Capital Technologies"],"production_companies":[{"name":"Kingdom Story Company"},{"name":"FletChet Entertainment"},{"name":"Lionsgate"},{"name":"Lumenas Studios"},{"name":"Media Capital Technologies"}],"cast":["Judy Greer","Pete Holmes","Molly Belle Wright","Lauren Graham","Sebastian Billingsley-Rodriguez"],"backdrop_path":"https://image.tmdb.org/t/p/original/w6nMvaWa3DcPTCNAb7SVNpBlvWh.jpg","poster_path":"https://image.tmdb.org/t/p/original/4fnJJTyuMgBvRFgLfSMKz8qkO1z.jpg","certification":"10","genres":["Comédia","Drama","Família"],"trailer":"N/A"},
