"14012":{"id":"14012","name":"Flicka","slug":"flicka","original_title":"Flicka","overview":"Em FLICKA, uma adaptação contemporânea de Minha Amiga Flicka, famoso livro de Mary O'Hara, Katy McLaughlin, uma garota de 16 anos, sonha em continuar a tradição de sua família trabalhando no rancho de seu pai, no Wyoming dos dias de hoje. Mas o pai de Katy deseja uma outra vida para ela: quer que ela vá para a faculdade. Um dia, Katy encontra uma linda égua selvagem, à qual ela dá o nome de Flicka (\"linda garota\" em sueco), e decide domá-la. Mas Flicka e Katy são mais parecidas do que ela poderia imaginar. Como Katy, Flicka desdenha a autoridade alheia e não quer abrir mão de sua liberdade sem brigar. Será que Katy conseguirá domar sua amada Flicka e provar que todos estão errados sobre sua égua selvagem? Será que seu pai vai encontrar uma forma de apoiar sua filha, mas ao mesmo tempo mantê-la a salvo nesse momento de mudanças em sua vida? E será que a família McLaughlin conseguirá manter sua vida no rancho que trabalharam tanto para construir?","first_air_date":"2006-10-20","runtime":95,"episode_run_time":[95],"vote_average":6.8,"created_by":["Fox 2000 Pictures","Zucker/Netter Productions"],"production_companies":[{"name":"Fox 2000 Pictures"},{"name":"Zucker/Netter Productions"}],"cast":["Alison Lohman","Tim McGraw","Maria Bello","Ryan Kwanten","Danny Pino"],"backdrop_path":"https://image.tmdb.org/t/p/original/8cpaUuYwSG24rOJZKyKOSdlcgY4.jpg","poster_path":"https://image.tmdb.org/t/p/original/1n7H1kdapk9GHysKxkPGPe7ITKU.jpg","certification":"N/A","genres":["Família","Drama"],"trailer":"N/A"},
