"399121":{"id":"399121","name":"O Oficial e o Espião","slug":"o-oficial-e-o-espiao","original_title":"J'accuse","overview":"Paris, final do século 19. O capitão francês Alfred Dreyfus é um dos poucos judeus que faz parte do exército. No dia 22 de dezembro de 1884, seus inimigos alcançam seu objetivo: conseguem fazer com que Dreyfus seja acusado de alta traição. Pelo crime, julgado à portas fechadas, o capitão é sentenciado à prisão perpétua no exílio. Intrigado com a evolução do caso, o investigador Picquart decide seguir as pistas para desvendar o mistério por trás da condenação de Dreyfus.","first_air_date":"2019-09-30","runtime":132,"episode_run_time":[132],"vote_average":7.1,"created_by":["R.P. Productions","Gaumont","France 3 Cinéma","France 2 Cinéma","Èliseo Entertainment","RAI Cinema","Légende Films"],"production_companies":[{"name":"R.P. Productions"},{"name":"Gaumont"},{"name":"France 3 Cinéma"},{"name":"France 2 Cinéma"},{"name":"Èliseo Entertainment"},{"name":"RAI Cinema"},{"name":"Légende Films"}],"cast":["Jean Dujardin","Louis Garrel","Emmanuelle Seigner","Grégory Gadebois","Hervé Pierre"],"backdrop_path":"https://image.tmdb.org/t/p/original/pP1UeRZ7shy1llOUTnpXWISOokK.jpg","poster_path":"https://image.tmdb.org/t/p/original/62U5xODn11soKOnXj0s0zc3iTlJ.jpg","certification":"14","genres":["História","Drama","Thriller"],"trailer":"OFXJELNxz2w"},
"567566":{"id":"567566","name":"A Outra Face da Guerra","slug":"a-outra-face-da-guerra","original_title":"Dvēseļu putenis","overview":"Depois de testemunhar sua mãe sendo baleada pelas tropas invasoras alemãs, Arturs, de 16 anos, junto com seu pai, decide se alistar nos batalhões de fuzileiros da Letônia do Exército Imperial Russo, na esperança de se vingar e encontrar a glória. Arturs continua a lutar na Primeira Guerra Mundial na Frente Oriental, onde perde seu pai e irmão, e rapidamente se desilude. Eventualmente, Arturs retorna ao seu recém-proclamado país para lutar na Guerra da Independência da Letônia e começar tudo do zero.","first_air_date":"2019-11-11","runtime":124,"episode_run_time":[124],"vote_average":7.3,"created_by":["KULTFILMA"],"production_companies":[{"name":"KULTFILMA"}],"cast":["Oto Brantevics","Vilis Daudziņš","Ivars Krasts","Gatis Gāga","Mārtiņš Vilsons"],"backdrop_path":"https://image.tmdb.org/t/p/original/hxPi9FOd46WEVajcjhON8m3sihG.jpg","poster_path":"https://image.tmdb.org/t/p/original/arlwPVSQg3fsBCDhwORpiHnZjYt.jpg","certification":"N/A","genres":["Guerra","Drama","História"],"trailer":"N/A"},
"385737":{"id":"385737","name":"Brilho Eterno","slug":"brilho-eterno","original_title":"Always Shine","overview":"Duas melhores amigas, Anna e Beth, decidem fazer uma viagem de fim de semana para as montanhas de Big Sur, na Califórnia, para tentar uma reaproximação e reestabelecer uma amizade abalada por anos de competição e inveja. Mas o confronto das duas releva reações inesperadas, trazendo a tona verdades ocultas sobre as duas e seu relacionamento, e mudando a vida delas para sempre.","first_air_date":"2016-11-25","runtime":85,"episode_run_time":[85],"vote_average":5.3,"created_by":["Salem Street Entertainment","Little Teeth Pictures"],"production_companies":[{"name":"Salem Street Entertainment"},{"name":"Little Teeth Pictures"}],"cast":["Mackenzie Davis","Caitlin FitzGerald","Lawrence Michael Levine","Khan Baykal","Alexander Koch"],"backdrop_path":"https://image.tmdb.org/t/p/original/pb898IkqZH57vlNqBpzw56HymJo.jpg","poster_path":"https://image.tmdb.org/t/p/original/gTDt04LtD1IUn8FWamBbKUBOQXq.jpg","certification":"N/A","genres":["Thriller","Drama","Terror","Mistério"],"trailer":"N/A"},
"6472":{"id":"6472","name":"O Guarda-Costas e a Primeira Dama","slug":"o-guarda-costas-e-a-primeira-dama","original_title":"Guarding Tess","overview":"Doug Chesnic (Nicolas Cage) é o guarda-costas de uma ex-primeira dama problemática, Tess Carlisle (Shirley MacLaine). Chesnic pensa que não será mais perturbado pela ilustre senhora pois não trabalhará mais para ela, mas descobre que Tess ligou para o presidente exigindo que ele mantenha Doug no cargo, pois, apesar de não aparentar, Tess tem um especial afeto por Chesnic.","first_air_date":"1994-03-11","runtime":96,"episode_run_time":[96],"vote_average":6.0,"created_by":["Channel Films","TriStar Pictures"],"production_companies":[{"name":"Channel Films"},{"name":"TriStar Pictures"}],"cast":["Shirley MacLaine","Nicolas Cage","Austin Pendleton","Edward Albert","James Rebhorn"],"backdrop_path":"https://image.tmdb.org/t/p/original/73i1mB62MdPkV9XNtKdBdrzlPKr.jpg","poster_path":"https://image.tmdb.org/t/p/original/hsJWfP6x7iv4uabUNTjyEg5y3xI.jpg","certification":"N/A","genres":["Comédia","Drama"],"trailer":"N/A"},
