"39413":{"id":"39413","name":"Minhas Tardes com Margueritte","slug":"minhas-tardes-com-margueritte","original_title":"La Tête en friche","overview":"Baseado no livro “La Tête en Friche”, de Marie-Sabine Roger.\r Quando criança, Germain (Gérard Depardieu) foi chamado de burro na escola por todos e em casa, com sua mãe solteira, não era diferente. A dificuldade de ler se perpetuou numa espécie de bloqueio intelectual. Já adulto, sua vida se resumia a viver de bicos, ainda ser alvo de brincadeira dos amigos e, principalmente, conviver com o eterno desamor da mãe. Contudo, quando Margueritte (Gisèle Casadesus) faz com que as páginas de um livro se abram novamente para ele, este reencontro com o universo das letras amplia seu horizonte e o único limite - agora - será somente a sua vontade.","first_air_date":"2010-06-02","runtime":82,"episode_run_time":[82],"vote_average":6.9,"created_by":["ICE3"],"production_companies":[{"name":"ICE3"}],"cast":["Gérard Depardieu","Maurane","Gisèle Casadesus","Jean-François Stévenin","Patrick Bouchitey"],"backdrop_path":"https://image.tmdb.org/t/p/original/4cUngFXI2P90dzyb9SEiiiocOZW.jpg","poster_path":"https://image.tmdb.org/t/p/original/tmak39EIqW2Rcsx5hKDFgfVORAt.jpg","certification":"N/A","genres":["Drama","Comédia"],"trailer":"9M3ArjDkPvA"},
