"324308":{"id":"324308","name":"Steve Jobs: O Homem e a Máquina","slug":"steve-jobs-o-homem-e-a-maquina","original_title":"Steve Jobs: The Man in the Machine","overview":"Em 2005, quando discursou na Universidade de Stanford, Steve Jobs pediu ajuda para escrever o discurso a Aaron Sorkin, mas acabou por o fazer sozinho, como conta Walter Isaacson na sua biografia do co-fundador da Apple. No início do discurso, Jobs dizia: “Hoje, quero contar-vos três histórias da minha vida. É só isso. Nada de especial. Só três histórias.” Nem por acaso, “Steve Jobs”, o filme de Danny Boyle com argumento de Aaron Sorkin, inspirado no citado livro de Isaacson, com Michael Fassbender no papel principal, é formado por três histórias da vida profissional de Jobs: o lançamento do Macintosh, em 1984; o do esquecido NeXT, em 1988; e o do iMac, em 1998.","first_air_date":"2015-08-07","runtime":128,"episode_run_time":[128],"vote_average":6.5,"created_by":["Magnolia Pictures","Jigsaw Productions","CNN Films"],"production_companies":[{"name":"Magnolia Pictures"},{"name":"Jigsaw Productions"},{"name":"CNN Films"}],"cast":["Bob Belleville","Chrisann Brennan","Nolan Bushnell","Jason Chen","Nick Denton"],"backdrop_path":"https://image.tmdb.org/t/p/original/qWg4uIcOeUlfDRBiVUFDLhb1H8B.jpg","poster_path":"https://image.tmdb.org/t/p/original/earqSeKTqVUdMpwvrHKqzoux6jv.jpg","certification":"16","genres":["Documentário"],"trailer":"N/A"},
"394741":{"id":"394741","name":"Stan & Ollie - O Gordo e o Magro","slug":"stan-ollie-o-gordo-e-o-magro","original_title":"Stan & Ollie","overview":"Conta a história real de uma das maiores duplas de comediantes de todos os tempos, Laurel e Hardy. Os dois embarcaram em uma longa jornada em sua turnê pela Grã-Bretanha, em 1953, buscando colocar suas carreiras novamente nos holofotes, mesmo com o mundo ainda abalado pelos efeitos da Segunda Guerra Mundial.","first_air_date":"2018-12-28","runtime":98,"episode_run_time":[98],"vote_average":7.0,"created_by":["Fable Pictures","Entertainment One","Baby Cow Productions","Sonesta Films","BBC Film","Sony Pictures Classics","Entertainment One Features","Sierra/Affinity"],"production_companies":[{"name":"Fable Pictures"},{"name":"Entertainment One"},{"name":"Baby Cow Productions"},{"name":"Sonesta Films"},{"name":"BBC Film"},{"name":"Sony Pictures Classics"},{"name":"Entertainment One Features"},{"name":"Sierra/Affinity"}],"cast":["Steve Coogan","John C. Reilly","Shirley Henderson","Nina Arianda","Rufus Jones"],"backdrop_path":"https://image.tmdb.org/t/p/original/6oyC0KcZPx9aqA1WkXtkfA1txXU.jpg","poster_path":"https://image.tmdb.org/t/p/original/gMk8iriC4lSPXG3HVmNqo13pHHJ.jpg","certification":"14","genres":["Comédia","Drama"],"trailer":"N/A"},
"29478":{"id":"29478","name":"O Sol Tornará a Brilhar","slug":"o-sol-tornara-a-brilhar","original_title":"A Raisin in the Sun","overview":"A família Younger, frustada com a vida em seu espremido apartamento em Chicago, vê a chegada de um cheque de dez mil dólares de um seguro como a resposta para suas preces. A matriarca Lena Younger imediatamente usa-o como parte do pagamento de uma casa num subúrbio cujos vizinhos são, em sua maioria, brancos. Mas a família se divide quando Lena confia a aplicação do dinheiro ao irrequieto filho Walter Lee, contra os desejos de sua filha e da nora.","first_air_date":"1961-05-28","runtime":128,"episode_run_time":[128],"vote_average":7.7,"created_by":["Columbia Pictures"],"production_companies":[{"name":"Columbia Pictures"}],"cast":["Sidney Poitier","Claudia McNeil","Ruby Dee","Diana Sands","Ivan Dixon"],"backdrop_path":"https://image.tmdb.org/t/p/original/ljFZlaGaB9fixUXhJYzIBPRrUTH.jpg","poster_path":"https://image.tmdb.org/t/p/original/5s98YppMrUGOP2b5xqrA0wVvIEt.jpg","certification":"N/A","genres":["Drama","Romance"],"trailer":"N/A"},
"14831":{"id":"14831","name":"Help!","slug":"help","original_title":"Help!","overview":"Help é o segundo filme da banda Britânica The Beatles. O álbum homónimo saiu no mesmo ano. O filme conta a história dum culto indiano que a cada dia escolhe uma vítima para ser sacrificada perante a deusa da morte kaili. Para isso, fornecem-lhe um anel que usará até que chegue a hora da sua morte. Porém este anel desaparece e descobre-se que foi enviado para Inglaterra, como presente a Ringo Starr, que caso não o devolva, se tornará a nova vítima. Porém, há um problema, ele não consegue tirá-lo do dedo.","first_air_date":"1965-07-29","runtime":92,"episode_run_time":[92],"vote_average":6.8,"created_by":["Subafilms"],"production_companies":[{"name":"Subafilms"}],"cast":["George Harrison","John Lennon","Paul McCartney","Ringo Starr","Leo McKern"],"backdrop_path":"https://image.tmdb.org/t/p/original/qhpib62efVnZon7yiYaV1hEb2kF.jpg","poster_path":"https://image.tmdb.org/t/p/original/iSfXaWMAvdlidvFd1g4p5nzVogE.jpg","certification":"e Livre","genres":["Comédia","Música","Aventura"],"trailer":"N/A"},
