"575088":{"id":"575088","name":"A Babá: O Chamado das Sombras","slug":"a-baba-o-chamado-das-sombras","original_title":"Яга. Кошмар тёмного леса","overview":"Uma família se muda recentemente para a nova casa após o nascimento do bebê. Logo, eles contratam uma babá para cuidar da recém-nascida. No entanto, Egor, o filho mais velho, fala sobre o comportamento assustador da mulher, mas seus pais não acreditam nele. Então, um dia, Egor chega em casa e não encontra vestígios da babá e nem da criança. Também se depara com os pais em transe, sem ao menos lembrar que tiveram uma filha.","first_air_date":"2020-02-27","runtime":94,"episode_run_time":[94],"vote_average":6.4,"created_by":["QS Films","Non-Stop Productions"],"production_companies":[{"name":"QS Films"},{"name":"Non-Stop Productions"}],"cast":["Олег Чугунов","Glafira Golubeva","Артём Жигулин","Игорь Хрипунов","Светлана Устинова"],"backdrop_path":"https://image.tmdb.org/t/p/original/4br4B8C0SRIYcKHUgoaOlGo50MU.jpg","poster_path":"https://image.tmdb.org/t/p/original/urbyC5UsvP8Ym15S4Rd3sZ9WBkw.jpg","certification":"N/A","genres":["Terror"],"trailer":"kL5wAOWArMA"},
"152792":{"id":"152792","name":"Sem Evidências","slug":"sem-evidencias","original_title":"Devil's Knot","overview":"Em 1993, os adolescentes Damien Echols, Jason Baldwin e Jessie Misskelley Jr. foram acusados de assassinar brutalmente três crianças de oito anos. Em um julgamento repleto de polêmicas e incertezas, eles foram condenados. Após uma longa batalha judicial, foram soltos no ano passado. Adaptação do livro \"The Devil’s Knot: The True Story of the West Memphis Three\".","first_air_date":"2013-05-09","runtime":114,"episode_run_time":[114],"vote_average":6.2,"created_by":["Worldview Entertainment"],"production_companies":[{"name":"Worldview Entertainment"}],"cast":["Reese Witherspoon","Colin Firth","Alessandro Nivola","James Hamrick","Seth Meriwether"],"backdrop_path":"https://image.tmdb.org/t/p/original/fyICKtzDeHosw97zoM6Tal7cied.jpg","poster_path":"https://image.tmdb.org/t/p/original/xtfhSGn6hBE3m47CCmDKLoyf60U.jpg","certification":"16","genres":["Crime","Drama","Thriller"],"trailer":"N/A"},
"18887":{"id":"18887","name":"A Lenda dos Anões Mágicos","slug":"a-lenda-dos-anoes-magicos","original_title":"Darby O'Gill and the Little People","overview":"Pegue um pouco de folclore antigo, misture alguns efeitos especiais espetaculares e um elenco mágico (incluindo Sean Connery) - e você tem uma das fantasias mais encantadoras de todos os tempos! Um velho contador de histórias chamado Darby O'Gill está procurando desesperadamente o proverbial Pote de Ouro. Há apenas uma pequena coisa em seu caminho: um Leprechaun de 21 polegadas (53 cm) chamado King Brian. Para conseguir o ouro, Darby deve toda sua perspicácia contra o maldito malandro - o que não é um trabalho fácil, na verdade! Caia sob o feitiço de A Lenda dos Anões Mágicos para uma noite cheia de diversão de magia, alegria e malandragens sem parar!","first_air_date":"1959-06-24","runtime":93,"episode_run_time":[93],"vote_average":6.7,"created_by":["Walt Disney Productions"],"production_companies":[{"name":"Walt Disney Productions"}],"cast":["Albert Sharpe","Janet Munro","Sean Connery","Jimmy O'Dea","Kieron Moore"],"backdrop_path":"https://image.tmdb.org/t/p/original/8SLK1d5oUGzA1Lz7fFHOIXYJgc3.jpg","poster_path":"https://image.tmdb.org/t/p/original/jHW6Txi5Ya2H93Xa3ioPY796aDz.jpg","certification":"N/A","genres":["Aventura","Família","Fantasia","Romance"],"trailer":"N/A"},
"32041":{"id":"32041","name":"O Inferno é Para os Heróis","slug":"o-inferno-e-para-os-herois","original_title":"Hell Is for Heroes","overview":"A realidade brutal que todos os G.I. enfrentaram durante a II Guerra Mundial. Um pequeno esquadrão deve segurar o ataque alemão. Focado em torno da ação de uma única manobra realizada por um pelotão de soldados americanos em retaliação contra a força alemã da linha de Siegfried. Reese se junta a um grupo de soldados cansados que, ​​inesperadamente, receberam a ordem de voltar para a linha de frente quando estavam a caminho da área de descanso.Enquanto a maioria dos homens se retiram de suas posições diante de uma casamata alemã, no lado mais distante de um campo de minas, meia dúzia de homens são deixados para proteger uma vasta frente.","first_air_date":"1962-06-26","runtime":90,"episode_run_time":[90],"vote_average":6.5,"created_by":["Paramount Pictures"],"production_companies":[{"name":"Paramount Pictures"}],"cast":["Steve McQueen","Bobby Darin","Fess Parker","Harry Guardino","James Coburn"],"backdrop_path":"https://image.tmdb.org/t/p/original/m1NdU25axOn22J42c9SDt3VNDhf.jpg","poster_path":"https://image.tmdb.org/t/p/original/nZ0h8V0jsS5NLKdUZIZ2I2xMWtR.jpg","certification":"12","genres":["Guerra"],"trailer":"N/A"},
"6619":{"id":"6619","name":"Morte em Veneza","slug":"morte-em-veneza","original_title":"Morte a Venezia","overview":"Início do século XX. Gustav von Aschenbach (Dirk Bogarde) é um compositor austríaco que vai para Veneza buscando repouso, após um período de estresse artístico e pessoal. Porém ele não encontra a paz desejada, pois logo desenvolve uma paixão por um jovem, Tadzio (Björn Andrésen), que está em férias com sua família. Tadzio incorpora o ideal de beleza que von Aschenbach sempre imaginou e pensa em ir embora antes de cometer um ato impensado, mas sua bagagem foi para outra cidade, obrigando-o a permanecer ali. Além disto a cólera asiática começa a chegar em Veneza.","first_air_date":"1971-03-05","runtime":131,"episode_run_time":[131],"vote_average":7.3,"created_by":["Alfa Cinematografica","Productions et Éditions Cinématographiques Françaises"],"production_companies":[{"name":"Alfa Cinematografica"},{"name":"Productions et Éditions Cinématographiques Françaises"}],"cast":["Dirk Bogarde","Björn Andrésen","Romolo Valli","Mark Burns","Nora Ricci"],"backdrop_path":"https://image.tmdb.org/t/p/original/tyWnJeMatQGLsiLfLsxBV0pp9nk.jpg","poster_path":"https://image.tmdb.org/t/p/original/cCstvgJ50J56JuN49BcOS73Uj4Q.jpg","certification":"N/A","genres":["Drama"],"trailer":"N/A"},
"205724":{"id":"205724","name":"Bem-vindo à Selva","slug":"bem-vindo-a-selva","original_title":"Welcome to the Jungle","overview":"O grupo de funcionários de uma empresa é enviado a umas férias na selva, com a ajuda do guia Storm. O que deveria ser uma viagem de descanso e autodescoberta acaba se transformando em um verdadeiro caos quando o piloto do avião fretado é encontrado morto, e ninguém sabe como fazer para voltar para casa.","first_air_date":"2013-04-27","runtime":95,"episode_run_time":[95],"vote_average":5.0,"created_by":["Private Island Trax","The Salt Company International","Pimienta","120dB Films","Stun Creative"],"production_companies":[{"name":"Private Island Trax"},{"name":"The Salt Company International"},{"name":"Pimienta"},{"name":"120dB Films"},{"name":"Stun Creative"}],"cast":["Jean-Claude Van Damme","Adam Brody","Rob Huebel","Kristen Schaal","Megan Boone"],"backdrop_path":"https://image.tmdb.org/t/p/original/ucvAwCzaRuQAydXKP1BPErgZIzR.jpg","poster_path":"https://image.tmdb.org/t/p/original/5fJYDJDv3xVs6VbjHHoARjVJf0o.jpg","certification":"N/A","genres":["Comédia"],"trailer":"N/A"},
