"82532":{"id":"82532","name":"Jeff e as Armações do Destino","slug":"jeff-e-as-armacoes-do-destino","original_title":"Jeff, Who Lives at Home","overview":"Jeff (Jason Segel) é um preguiçoso de 30 anos que ainda mora no porão da casa da mãe. Ele espera por sinais do universo que mostrem o que deve fazer da sua vida, mas, enquanto isso ele não trabalha e vive as custas da mãe. Certo dia, ele decide ajudar seu irmão Pat (Ed Helms), que suspeita que a esposa o está traindo, e os fatos aparecem.","first_air_date":"2012-03-16","runtime":83,"episode_run_time":[83],"vote_average":6.2,"created_by":["Indian Paintbrush","Paramount Vantage","Right of Way Films","Duplass Brothers Productions","Mr. Mudd"],"production_companies":[{"name":"Indian Paintbrush"},{"name":"Paramount Vantage"},{"name":"Right of Way Films"},{"name":"Duplass Brothers Productions"},{"name":"Mr. Mudd"}],"cast":["Jason Segel","Ed Helms","Susan Sarandon","Judy Greer","Rae Dawn Chong"],"backdrop_path":"https://image.tmdb.org/t/p/original/2TlVQC5s6veC9MZSIj9K2Drrb.jpg","poster_path":"https://image.tmdb.org/t/p/original/5COI3XXA9VRi5MrYqXfTXpERfbA.jpg","certification":"N/A","genres":["Drama","Comédia"],"trailer":"N/A"},
"138376":{"id":"138376","name":"O Agente","slug":"o-agente","original_title":"A Dark Truth","overview":"Jack Begosian (Andy Garcia) é um espião da CIA aposentado, que hoje trabalha como apresentador de um programa de rádio. Um dia, Morgan Swinton (Deborah Kara Unger) decide contratá-lo para investigar a implicação do governo dos Estados Unidos no massacre de um vilarejo na América do Sul. Jack vai ao local para descobrir a verdade, mas ele acaba reacendendo uma verdadeira batalha política.","first_air_date":"2012-11-29","runtime":106,"episode_run_time":[106],"vote_average":5.6,"created_by":["Vortex Words + Pictures"],"production_companies":[{"name":"Vortex Words + Pictures"}],"cast":["Andy García","Deborah Kara Unger","Eva Longoria","Forest Whitaker","Steven Bauer"],"backdrop_path":"https://image.tmdb.org/t/p/original/l6v0jS8Q2LU8tNw5N104MkhCji5.jpg","poster_path":"https://image.tmdb.org/t/p/original/c515qnpmblMoU1XYnrq9ea1Wdim.jpg","certification":"N/A","genres":["Ação","Thriller"],"trailer":"N/A"},
"14292":{"id":"14292","name":"Desafio no Gelo","slug":"desafio-no-gelo","original_title":"Miracle","overview":"Colorado Springs, 1979, Associação Americana de Hóquei Amador. Lá acontece uma reunião com Herb Brooks (Kurt Russell), que está sendo sondado para ser o novo técnico da equipe nacional. Ao voltar para St. Paul, Minnesota, onde vive, Herb diz para sua mulher, Patty (Patricia Clarkson), que nada aconteceu de positivo e que ele não é o técnico que desejam, sendo chamado apenas para uma conversa após dois técnicos terem recusado o cargo. Assim é com surpresa que recebe uma ligação do Colorado dizendo que o emprego é dele. Herb seleciona 26 jovens atletas, mas 6 serão cortados, para em fevereiro de 1980 em Lake Placid disputarem os Jogos Olímpicos de Inverno. Brooks treina seus atletas de uma forma polêmica, pois ele sonha derrotar a equipe da União Soviética, que é considerada imbatível.","first_air_date":"2004-02-06","runtime":135,"episode_run_time":[135],"vote_average":7.1,"created_by":["Walt Disney Pictures"],"production_companies":[{"name":"Walt Disney Pictures"}],"cast":["Kurt Russell","Patricia Clarkson","Nathan West","Noah Emmerich","Sean McCann"],"backdrop_path":"https://image.tmdb.org/t/p/original/wCcz89uLIjZ7PKwGvrsQTz0vqe2.jpg","poster_path":"https://image.tmdb.org/t/p/original/dGxGB9bDgzTlnOowHy20XclZJgi.jpg","certification":"N/A","genres":["Drama","História"],"trailer":"N/A"},
"9582":{"id":"9582","name":"Louco por Elas","slug":"louco-por-elas","original_title":"A Guy Thing","overview":"Após sua despedida de solteiro, Paul amanhece ao lado da dançarina Becky e faz de tudo para que sua noiva não descubra a traição. Mas as coisas se complicam, quando ele descobre que Becky é prima de sua namorada.","first_air_date":"2003-01-17","runtime":101,"episode_run_time":[101],"vote_average":5.9,"created_by":["David Ladd Films","Metro-Goldwyn-Mayer"],"production_companies":[{"name":"David Ladd Films"},{"name":"Metro-Goldwyn-Mayer"}],"cast":["Jason Lee","Selma Blair","Julia Stiles","Shawn Hatosy","Lochlyn Munro"],"backdrop_path":"https://image.tmdb.org/t/p/original/Txzcr6Iqdam6WufVLlGEVz6N70.jpg","poster_path":"https://image.tmdb.org/t/p/original/oK63C3dGUDKC1TPFLlgJx8RrHX0.jpg","certification":"N/A","genres":["Comédia","Romance"],"trailer":"N/A"},
