"243352":{"id":"243352","name":"Onde Nasce a Esperança","slug":"onde-nasce-a-esperanca","original_title":"Where Hope Grows","overview":"Onde Nasce a Esperança é a história inspiradora sobre a redenção através da amizade, da esperança e do amor. Calvin Campbell é um ex-jogador de beisebol profissional que enfrenta dificuldades com as jogadas que o destino preparou para ele. Sua vida ganha um novo sentido quando conhece Produce, um jovem garoto com Síndrome de Down que trabalha no supermercado do bairro. Com o desenvolvimento desta amizade, Calvin recorda que às vezes a esperança pode crescer mesmo onde não se espera.","first_air_date":"2014-04-06","runtime":95,"episode_run_time":[95],"vote_average":6.8,"created_by":["Godspeed Pictures"],"production_companies":[{"name":"Godspeed Pictures"}],"cast":["Danica McKellar","William Zabka","Kerr Smith","McKaley Miller","Kristoffer Polaha"],"backdrop_path":"https://image.tmdb.org/t/p/original/fLJUO27NcQymwcBkNX4Na8NNk64.jpg","poster_path":"https://image.tmdb.org/t/p/original/ub2PyFEqUhloJYRUeYfV2wEd4VK.jpg","certification":"N/A","genres":["Drama"],"trailer":"N/A"},
"18885":{"id":"18885","name":"3 Ninjas Contra-Atacam","slug":"3-ninjas-contra-atacam","original_title":"3 Ninjas Kick Back","overview":"Acompanhando seus avós ao Japão, os três jovens ninjas acabam no meio de um conflito de artes marciais. Perseguidos por um trio de alucinados ladrões e um exército de ninjas bem treinados, Rocky, Colt e Tum Tum, têm que usar todas as suas habilidades, nesta comédia de ação que não deixa a alegria baixar.","first_air_date":"1994-02-25","runtime":93,"episode_run_time":[93],"vote_average":5.6,"created_by":["TriStar Pictures","Sheen Productions","Leeds/Ben-Ami Productions"],"production_companies":[{"name":"TriStar Pictures"},{"name":"Sheen Productions"},{"name":"Leeds/Ben-Ami Productions"}],"cast":["Victor Wong","Max Elliott Slade","Sean Fox","J. Evan Bonifant","Caroline Junko King"],"backdrop_path":"https://image.tmdb.org/t/p/original/xTAQrUKwKvUvWCowY8XLlD0uFE2.jpg","poster_path":"https://image.tmdb.org/t/p/original/uasTCrxzDg4ijN41EOaV7ZGmI79.jpg","certification":"N/A","genres":["Família","Aventura","Ação","Comédia"],"trailer":"N/A"},
"13503":{"id":"13503","name":"Texas Rangers: Acima da Lei","slug":"texas-rangers-acima-da-lei","original_title":"Texas Rangers","overview":"Durante a Guerra Civil, Leander McNelly, capitão dos Texas Rangers, deixa sua família e seu posto no sul do Texas para lutar ao lado de seus homens pela Confederação. Terminada a Guerra, McNelly volta, mas sua mulher e filhos desapareceram, levados por bandidos. Depois de dez anos, o governador procura McNelly para reorganizar os Texas Rangers. Enquanto isso, o jovem Lincoln, que acaba de terminar os estudos e voltar para o Texas, tem sua família inteira assassinada por ladrões de gado e decide se tornar um Texas Ranger. Juntos, eles se envolvem em uma perigosa batalha, juraram proteger os inocentes e as mulheres que amam, arriscando a própria vida para defender seu território e aprendem que o cumprimento da lei é, acima de tudo, um ato de valentia.","first_air_date":"2001-11-30","runtime":90,"episode_run_time":[90],"vote_average":6.1,"created_by":["Dimension Films"],"production_companies":[{"name":"Dimension Films"}],"cast":["James Van Der Beek","Dylan McDermott","Usher","Ashton Kutcher","Robert Patrick"],"backdrop_path":"https://image.tmdb.org/t/p/original/h2CWPTirO4BGjG5KQ5Gubt2T6jX.jpg","poster_path":"https://image.tmdb.org/t/p/original/69tMHlxiCYlYKGZm1aPH1u7hY88.jpg","certification":"N/A","genres":["Faroeste","Ação"],"trailer":"N/A"},
"13778":{"id":"13778","name":"Dickie Roberts: O Pestinha Cresceu","slug":"dickie-roberts-o-pestinha-cresceu","original_title":"Dickie Roberts: Former Child Star","overview":"Nos anos 70, Dickie Roberts tinha a chave da fama de um seriado de sucesso na TV, como astro infantil. Agora as únicas chaves que ele tem são as dos carros que estaciona, como manobrista num restaurante em Hollywood. Desesperado para reviver sua carreira, Dickie tenta fazer um teste para o novo filme de Rob Reiner, mas o diretor não acredita que ele seja normal o bastante para o personagem. Decidido a conseguir o papel, Dickie contrata uma família \"típica\" para aprender a vida real que nunca teve. Mas assim que ele se muda, a vida da família se torna tudo, menos normal, à medida que Dickie libera seu pestinha interior... e vai aprendendo lições inesquecíveis sobre fama, fortuna e os verdadeiros valores familiares.","first_air_date":"2003-09-04","runtime":98,"episode_run_time":[98],"vote_average":5.1,"created_by":["Paramount Pictures","Happy Madison Productions"],"production_companies":[{"name":"Paramount Pictures"},{"name":"Happy Madison Productions"}],"cast":["David Spade","Mary McCormack","Jon Lovitz","Craig Bierko","Alyssa Milano"],"backdrop_path":"https://image.tmdb.org/t/p/original/nfkGXr1OSE2lyG16EWEdNT3vtZJ.jpg","poster_path":"https://image.tmdb.org/t/p/original/8zuPHnF9ItodK4f5Xxw3qELUaPa.jpg","certification":"12","genres":["Comédia"],"trailer":"N/A"},
