"264525":{"id":"264525","name":"A Ditadura Perfeita","slug":"a-ditadura-perfeita","original_title":"La dictadura perfecta","overview":"Depois de mais uma das frequentes gafes cometidas pelo presidente da República, o MX TV, maior TV do México, tem que ajudar seu aliado político antes que a polêmica gere uma crise na sua imagem. Para isso, a televisão tenta desviar a atenção do povo exibindo, em horário nobre, um vídeo onde o Governador Carmelo Vargas (Damián Alcázar) pratica corrupção. Desesperado para salvar seu futuro político, Vargas decide fechar um acordo secreto com a própria emissora que o denunciou para mudar sua imagem e torná-lo a nova estrela política do país. Mas para lançar esse possível novo candidato à presidência a qualquer custo, a situação acaba fugindo do controle.","first_air_date":"2014-10-16","runtime":143,"episode_run_time":[143],"vote_average":7.3,"created_by":["Bandidos Films"],"production_companies":[{"name":"Bandidos Films"}],"cast":["Damián Alcázar","Alfonso Herrera","Joaquín Cosío","Osvaldo Benavides","Silvia Navarro"],"backdrop_path":"https://image.tmdb.org/t/p/original/smwA94FaQBSVy4W4yjyZjU8aRT5.jpg","poster_path":"https://image.tmdb.org/t/p/original/pjNWekSbafFIPLBNZQ9gUaX3tkV.jpg","certification":"N/A","genres":["Drama","Comédia"],"trailer":"N/A"},
