"8998":{"id":"8998","name":"Amigas com Dinheiro","slug":"amigas-com-dinheiro","original_title":"Friends with Money","overview":"Frannie (Joan Cusack), Jane (Frances McDormand), Olivia (Jennifer Aniston) e Christine (Catherine Keener) são amigas desde que se tornaram adultas. Frannie, Jane e Christine vivem em uma situação financeira melhor, que lhes possibilita viver com um maior conforto. Já Olivia enfrenta problemas com dinheiro, parecendo ser incapaz de conseguir estabilidade em um emprego e até mesmo em seus relacionamentos. A amizade faz com que as quatro sempre andem juntas, com Olivia evitando ao máximo o assunto dinheiro e às vezes até mesmo aceitando a generosidade das amigas. A diferença de estilo de vida entre elas se torna ainda maior quando Olivia deixa seu emprego de professora e passa a limpar casas como meio de sobrevivência.","first_air_date":"2006-04-07","runtime":88,"episode_run_time":[88],"vote_average":5.1,"created_by":["This is that","Sony Pictures Classics"],"production_companies":[{"name":"This is that"},{"name":"Sony Pictures Classics"}],"cast":["Jennifer Aniston","Joan Cusack","Catherine Keener","Frances McDormand","Jason Isaacs"],"backdrop_path":"https://image.tmdb.org/t/p/original/6ReVMJu87CMRH9ev0Py82weI1ro.jpg","poster_path":"https://image.tmdb.org/t/p/original/nsP16a52su1wDwZlj9O48BW8XwY.jpg","certification":"N/A","genres":["Comédia","Drama","Romance"],"trailer":"N/A"},
