"11112":{"id":"11112","name":"O Sócio","slug":"o-socio","original_title":"The Associate","overview":"A analista financeira Laurel Ayres é inteligente, esperta e talentosa em matéria de investimentos. Ela parece ter todos os elementos certos para ter sucesso e chegar ao topo das corporações em Wall Street, mas é preterida em sua tão almejada promoção para o ardiloso colega de trabalho Frank. É nesse momento que sua vida e carreira dão uma virada total. Ela monta um plano engenhoso e arriscado: para ter credibilidade, ela precisa de um sócio homem, um mago das finanças que atraia clientes. Mas ela não conhece tal homem. E por que não criá-lo? Com o personagem de \"Robert S. Cutty\", Laurel habilmente arma um mundo de ilusão e sucesso que conquista a todos nesse nervoso mundo das finanças.","first_air_date":"1996-10-25","runtime":108,"episode_run_time":[108],"vote_average":6.2,"created_by":["Interscope Communications","Universal Pictures","Hollywood Pictures"],"production_companies":[{"name":"Interscope Communications"},{"name":"Universal Pictures"},{"name":"Hollywood Pictures"}],"cast":["Whoopi Goldberg","Dianne Wiest","Eli Wallach","Tim Daly","Bebe Neuwirth"],"backdrop_path":"https://image.tmdb.org/t/p/original/pzSXjRmejFNQUrqXqDyVlQhLVBo.jpg","poster_path":"https://image.tmdb.org/t/p/original/lUEEpDJNwBBsnWFKTCcOlETqRuo.jpg","certification":"N/A","genres":["Comédia"],"trailer":"N/A"},
