"440626":{"id":"440626","name":"Sobibor: A Revolta que Mudou os Rumos da Humanidade","slug":"sobibor-a-revolta-que-mudou-os-rumos-da-humanidade","original_title":"Собибор","overview":"O ano de 2018 marca o 75º aniversário da fuga do Campo de Sobibor. O renomado ator russo Konstantin Khabenskiy faz o papel principal, como Alexander \"Sasha\" Pechersky, além de dirigir o filme. Khabenskiy disse que o filme não é uma representação documental dos eventos, mas uma \"história ficcionalizada\". Outro papel de destaque, é o do comandante do campo, Karl Frenzel, interpretado pelo ator Christopher Lambert.","first_air_date":"2018-05-03","runtime":111,"episode_run_time":[111],"vote_average":6.6,"created_by":["Patriot Productions","Karoprokat","Channel One","Ministry of Culture of the Russian Federation","All Media A Start Company"],"production_companies":[{"name":"Patriot Productions"},{"name":"Karoprokat"},{"name":"Channel One"},{"name":"Ministry of Culture of the Russian Federation"},{"name":"All Media A Start Company"}],"cast":["Константин Хабенский","Christopher Lambert","Michalina Olszańska","Felice Jankell","Мария Кожевникова"],"backdrop_path":"https://image.tmdb.org/t/p/original/fx70AwHSIDkX6U8WNfUQW53SoU3.jpg","poster_path":"https://image.tmdb.org/t/p/original/ggX7hyJr3toYvNzu8FtcYNUQlME.jpg","certification":"N/A","genres":["Guerra","Drama"],"trailer":"tXt4rGKm8EI"},
