"331190":{"id":"331190","name":"Refém","slug":"refem","original_title":"Captive","overview":"Ashley Smith é uma mãe solteira, enfrentando sérios problemas financeiros e tentando se livrar da dependência de drogas. Logo após perder a guarda de sua filha, ela é mantida refém em sua própria casa por Brian Nichols, um prisioneiro com matou o juiz de seu processo e fugiu. Enquanto ele tenta se esconder da polícia, ela busca uma maneira de rever a filha. Aos poucos, nasce uma amizade entre os dois, ajudada por um livro cristão que prega a fé e o arrependimento.","first_air_date":"2015-09-17","runtime":97,"episode_run_time":[97],"vote_average":5.7,"created_by":["Itaca Films","BN Films","1019 Entertainment","Brightside Entertainment","Yoruba Saxon Productions"],"production_companies":[{"name":"Itaca Films"},{"name":"BN Films"},{"name":"1019 Entertainment"},{"name":"Brightside Entertainment"},{"name":"Yoruba Saxon Productions"}],"cast":["Kate Mara","David Oyelowo","Michael Kenneth Williams","Mimi Rogers","Leonor Varela"],"backdrop_path":"https://image.tmdb.org/t/p/original/jeLEiX8my7cqEO7Ut5LOgc45Oet.jpg","poster_path":"https://image.tmdb.org/t/p/original/xTKqLPsKLDep3QQmwPGPfJNMNVF.jpg","certification":"14","genres":["Crime","Drama","Thriller"],"trailer":"N/A"},
