"430424":{"id":"430424","name":"Nos Vemos no Paraíso","slug":"nos-vemos-no-paraiso","original_title":"Au revoir là-haut","overview":"Novembro de 1918. Dias antes do Armistício, Édouard Péricourt salva a vida de Albert Maillard. Estes dois homens não tem nada em comum além da guerra. O tenente Padrelle, ao autorizar um ataque, destrói a vida de ambos enquanto os juntam sob a miséria. Nas ruínas da matança da Primeira Guerra Mundial, os dois tentam sobreviver e enquanto Pradelle está prestes a ganhar uma fortuna com as vítimas da guerra, Édouard e Albert bolam um plano monumental com as famílias dos mortos e com um herói nacional.","first_air_date":"2017-10-25","runtime":113,"episode_run_time":[113],"vote_average":7.8,"created_by":["Gaumont","Stadenn Productions","Manchester Films","France 2 Cinéma","Canal+","Ciné+","France Télévisions","Entourage Pictures"],"production_companies":[{"name":"Gaumont"},{"name":"Stadenn Productions"},{"name":"Manchester Films"},{"name":"France 2 Cinéma"},{"name":"Canal+"},{"name":"Ciné+"},{"name":"France Télévisions"},{"name":"Entourage Pictures"}],"cast":["Nahuel Pérez Biscayart","Albert Dupontel","Laurent Lafitte","Niels Arestrup","Émilie Dequenne"],"backdrop_path":"https://image.tmdb.org/t/p/original/5SIG1udUB85E00kEZMk7WlGoJDu.jpg","poster_path":"https://image.tmdb.org/t/p/original/3xTImsBYSIqLZfWCHfqWj9IC365.jpg","certification":"N/A","genres":["Drama","Crime","Guerra"],"trailer":"e_WrCTb8h3o"},
"362057":{"id":"362057","name":"Martírio","slug":"martirio","original_title":"Martyrs","overview":"Duas mulheres são sequestradas e caem nas mãos de um grupo de fanáticos que acreditam no poder do martírio e do sacrifício. Eles julgam que novos conhecimentos podem ser obtidos através da tortura aplicada às duas, submetendo-as aos atos de violência mais cruéis. Quando finalmente escapam, elas buscam vingança.","first_air_date":"2015-10-09","runtime":85,"episode_run_time":[85],"vote_average":5.1,"created_by":["Temple Hill Entertainment","Blumhouse Productions","The Safran Company"],"production_companies":[{"name":"Temple Hill Entertainment"},{"name":"Blumhouse Productions"},{"name":"The Safran Company"}],"cast":["Troian Bellisario","Bailey Noble","Kate Burton","Caitlin Carmichael","Melissa Tracy"],"backdrop_path":"https://image.tmdb.org/t/p/original/aMAIOGMVAtwNRtlMvGPDIkGchk9.jpg","poster_path":"https://image.tmdb.org/t/p/original/AtvsCQLAxFlEajpi2VBbmTSil1u.jpg","certification":"N/A","genres":["Terror","Mistério"],"trailer":"kQeZCPDOhAs"},
"13681":{"id":"13681","name":"Um Lugar no Coração","slug":"um-lugar-no-coracao","original_title":"Places in the Heart","overview":"Nos anos 30, em Waxahachie, Texas, durante a Grande Depressão, Edna Spalding (Sally Field) é uma viúva que luta desesperadamente para manter a família unida e salvar a sua fazenda de algodão, apesar de sofrer pressões por dar emprego a um negro (o marido dela foi morto por um negro, que estava armado e bêbado). Juntamente com Will (John Malkovich), um inquilino cego, ela consegue forças para tentar superar os problemas.","first_air_date":"1984-09-11","runtime":111,"episode_run_time":[111],"vote_average":7.2,"created_by":["TriStar Pictures","Delphi II Productions"],"production_companies":[{"name":"TriStar Pictures"},{"name":"Delphi II Productions"}],"cast":["Sally Field","Lindsay Crouse","John Malkovich","Danny Glover","Ed Harris"],"backdrop_path":"https://image.tmdb.org/t/p/original/r9XdfG1tqspRP5s0ir9zf5TIf0J.jpg","poster_path":"https://image.tmdb.org/t/p/original/nTHJdJ63YmUzf3lMh3lVvfZqRhn.jpg","certification":"N/A","genres":["Drama"],"trailer":"N/A"},
