"633374":{"id":"633374","name":"Vingança Pelo Passado","slug":"vinganca-pelo-passado","original_title":"리멤버","overview":"Pil-ju, um soldado aposentado de 80 anos com demência, vai em busca das pessoas que ele acredita serem responsáveis pela morte de sua família no passado. Com 5 nomes tatuados nos dedos e pedaços de suas memórias em colapso, ele rastreia seu alvo e os mata. Um jovem inocente (In-gyu) se envolve involuntariamente em sua vingança e se torna o principal suspeito dos assassinato. Para provar sua inocência e parar a pressa desse velho, In-gyu não pode deixar de acompanhar a jornada de vingança de Pil-ju.","first_air_date":"2022-10-26","runtime":128,"episode_run_time":[128],"vote_average":7.5,"created_by":["Moonlight Film","Acemaker Movieworks"],"production_companies":[{"name":"Moonlight Film"},{"name":"Acemaker Movieworks"}],"cast":["이성민","남주혁","박근형","정만식","윤제문"],"backdrop_path":"https://image.tmdb.org/t/p/original/ru2LECaGqWtsL3kRWWJ3EoDlF5J.jpg","poster_path":"https://image.tmdb.org/t/p/original/nO8cPPQOVN2D1kQG26tdNfgrPay.jpg","certification":"N/A","genres":["Thriller","Ação","Drama"],"trailer":"N/A"},
