"66125":{"id":"66125","name":"Cão Vermelho","slug":"cao-vermelho","original_title":"Red Dog","overview":"Red Dog é baseado na lendária e real história do cão que, unido a uma comunidade, cruzou a Austrália em busca de seu dono. Desde que o seu segundo dono, um motorista de ônibus chamado John Grant morreu, em 1975, Tally Ho (o nome orignal do cão) passou a andar por conta própria pelo deserto australiano em busca do seu dono. Red Dog (Cão Vermelho) ganhou esse apelido dos membros das comunidades que ele frequentava por causa da poeira vermelha do oeste australiano. (noriegaRJ)","first_air_date":"2011-08-04","runtime":92,"episode_run_time":[92],"vote_average":7.3,"created_by":["Endymion Films","ScreenWest","Woss Group Film Productions","Screen Australia","Essential Entertainment","South Australian Film Corporation"],"production_companies":[{"name":"Endymion Films"},{"name":"ScreenWest"},{"name":"Woss Group Film Productions"},{"name":"Screen Australia"},{"name":"Essential Entertainment"},{"name":"South Australian Film Corporation"}],"cast":["Josh Lucas","Rachael Taylor","Rohan Nichol","Luke Ford","Arthur Angel"],"backdrop_path":"https://image.tmdb.org/t/p/original/wNJAXms3tiKSZ5Q9H5LPa3PkgPA.jpg","poster_path":"https://image.tmdb.org/t/p/original/shc5BmoNv8uBA4qC6I3E1iR76Ls.jpg","certification":"12","genres":["Drama","Comédia","Família"],"trailer":"N/A"},
