"668640":{"id":"668640","name":"Concorrência Oficial","slug":"concorrencia-oficial","original_title":"Competencia oficial","overview":"Em busca de importância e prestígio social, um empresário bilionário decide fazer um filme que perpetue seu legado. Para isso, ele contrata um time formado pela famosa cineasta Lola Cuevas e dois atores renomados, donos de enorme talento, mas com um ego ainda maior: o ator hollywoodiano Félix Rivero, e o ator de teatro radical Iván Torres. Ambos são lendas, mas não exatamente melhores amigos. Através de uma série de provas cada vez mais excêntrica estabelecidas por Lola, Félix e Iván devem enfrentar não apenas um ao outro, mas também seus próprios egos.","first_air_date":"2021-09-04","runtime":114,"episode_run_time":[114],"vote_average":6.7,"created_by":["The Mediapro Studio","TV3","Orange","TVE"],"production_companies":[{"name":"The Mediapro Studio"},{"name":"TV3"},{"name":"Orange"},{"name":"TVE"}],"cast":["Antonio Banderas","Penélope Cruz","Oscar Martínez","José Luis Gómez","Manolo Solo"],"backdrop_path":"https://image.tmdb.org/t/p/original/cuyXEls6uOMDqflx2MSzZOuQSn2.jpg","poster_path":"https://image.tmdb.org/t/p/original/fey5dXqHTc4SUJs96Hv1Li9ezpD.jpg","certification":"14","genres":["Comédia","Drama"],"trailer":"N/A"},
