"1890":{"id":"1890","name":"Filhos do Silêncio","slug":"filhos-do-silencio","original_title":"Children of a Lesser God","overview":"História comovente e sensível sobre a relação entre professor e sua aluna surda, que cada vez mais se retrai em seu mundo particular, o que ele tenta impedir ajudando-a a se aproximar daqueles que a cercam. O professor de língua de sinais apaixona-se por sua aluna surda, que tem dificuldades de relacionamento com as pessoas, Sarah (a personagem surda), que é violada pelos amigos da irmã, que leva os rapazes até ela, pois esta era uma boa utilidade a ser dada a quem não ouve. Sarah tem sonhos de se tornar independente, mesmo sendo surda ela acredita no seu potencial e quer buscar o seu espaço.","first_air_date":"1986-09-13","runtime":119,"episode_run_time":[119],"vote_average":6.9,"created_by":["Paramount Pictures"],"production_companies":[{"name":"Paramount Pictures"}],"cast":["William Hurt","Marlee Matlin","Piper Laurie","Philip Bosco","Allison Gompf"],"backdrop_path":"https://image.tmdb.org/t/p/original/fiC5azwRjJmrwI59BlVpLqIegU1.jpg","poster_path":"https://image.tmdb.org/t/p/original/dU8oMTBHlb3cDYYSrMbbobJGRJU.jpg","certification":"N/A","genres":["Drama","Romance"],"trailer":"N/A"},
