"14517":{"id":"14517","name":"Máscara da Ilusão","slug":"mascara-da-ilusao","original_title":"MirrorMask","overview":"Máscara da Ilusão é a história de Helena, que trabalha para um circo e deseja, ironicamente, fugir e viver uma vida comum. Mas este não é o caso, uma vez que ela se encontra em uma estranha jornada rumo a Dark Lands, um lugar fantástico repleto de gigantes, pássaros-macaco e esfinges perigosas. Helena está à procura da Máscara da Ilusão, um objeto de enorme poder que é a sua única esperança de escapar de Dark Lands, acordar a Rainha da Luz e retornar para casa.","first_air_date":"2005-01-25","runtime":101,"episode_run_time":[101],"vote_average":6.4,"created_by":["The Jim Henson Company","Destination Films"],"production_companies":[{"name":"The Jim Henson Company"},{"name":"Destination Films"}],"cast":["Stephanie Leonidas","Jason Barry","Rob Brydon","Gina McKee","Dora Bryan"],"backdrop_path":"https://image.tmdb.org/t/p/original/zDkLBWZmt8jZrEhdKoUKoaEwETC.jpg","poster_path":"https://image.tmdb.org/t/p/original/wJHDs5OBESTJ4rbBUg2YHhQnrWN.jpg","certification":"N/A","genres":["Fantasia"],"trailer":"N/A"},
